import React from 'react';
import Hornedbeast from './Hornedbeast.js';
import data from './data.json';
class Main extends React.Component {
  render(){
    console.log(data)
    let beast = [];
    data.forEach((animal, idx) => {
      beast.push(
        <Hornedbeast
        name = {animal.name}
        img_url = {animal.img_url}
        key = {idx}
        />
        )
      });
      return(
        <main>
          {beast} 
        </main>
      );
  console.log(beast)
}
}
export default Main;
